DROP TABLE IF EXISTS `t_etl_job`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_etl_job` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `job_name` varchar(100) NOT NULL COMMENT 'job名称主键',
  `job_status` varchar(45) NOT NULL DEFAULT 'Done' COMMENT 'job 运行状态 Pending、Running、Done、Failed',
  `pending_time` varchar(45) DEFAULT NULL COMMENT 'pending 时间',
  `last_start_time` varchar(45) DEFAULT NULL COMMENT '上次job运行开始时间',
  `last_end_time` varchar(45) DEFAULT NULL COMMENT '上次job运行结束时间',
  `job_script` varchar(200) DEFAULT NULL,
  `retry_count` int(11) NOT NULL DEFAULT '1' COMMENT '重试次数',
  `job_trigger` varchar(45) DEFAULT NULL COMMENT 'job 触发方式 time、depdency',
  `job_priority` int(11) NOT NULL DEFAULT '1' COMMENT '优先级,数字越大级别越高',
  `last_run_date` varchar(45) DEFAULT NULL COMMENT '上次运行日期',
  `main_man` varchar(45) DEFAULT NULL COMMENT 'job 负责人',
  `enable` int(11) NOT NULL DEFAULT '0' COMMENT '0 可用 1 不可用',
  `job_desc` varchar(100) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`,`job_name`),
  UNIQUE KEY `ind_unique_job_name` (`job_name`),
  KEY `job_name_status` (`job_name`,`job_status`)
) ENGINE=InnoDB AUTO_INCREMENT=191 DEFAULT CHARSET=utf8;
